import React from 'react';
import  ReactDOM  from 'react-dom/client';
import './index.css';
import App from './App';

function MadeGoal(){
  return (<h1>Goal hogya</h1>)
}
 function MissedGoal(){
  return(<h1>Missed hogya Goal</h1>)
 }


 function Goal(props){
  const isGoal = props.isGoal;
  if(isGoal){
   return(
    <MadeGoal />
   )
  }
  return(
    <MissedGoal />
  )
 }
const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  // <React.StrictMode>
  //   <App />
  // </React.StrictMode>
  <Goal isGoal = {true}/>

);
